import React from 'react';

const NewHome = () => {
	return (
		<div className="headerMain">
			<h1> Hey, I'm Matt!</h1>
			<h3 className="lightText70 max-width700">
				I'm a senior product designer, an energetic lad, a coding enthusiast, a dog lover & a waterfall
				fantastic !
			</h3>

			<p className="badge">Available for full-time opportunities </p>
		</div>
	);
};

export default NewHome;
